import React, { Suspense } from 'react'
import LazyLoader from '../Components/Layout/LazyLoader'

const RegisterPage = () => {
  return (
    <Suspense fallback={<LazyLoader/>}>
       <div>
      <h2>register</h2>
    </div>
     </Suspense>
    
  )
}

export default RegisterPage
